import React, { useState, useEffect, useContext } from "react";
import { useParams } from "react-router-dom";

import { Context } from '../Context';

function Chat() {
  const { chatId } = useParams();
  const [chatEntriesState, setChatEntriesState] = useState([]);
  const { getChatEntriesOfUser } = useContext(Context);

  useEffect(() => {
    async function getResponse() {
      try{
        await getChatEntriesOfUser().then((response) => {
          console.log("Chat: allChatsOfUser: " + response.data);
          setChatEntriesState(response.data);
        })
      } catch {
        console.log("Failed to retrive allChatsOfUser");
      }
    };
    getResponse();
  }, []);

  return (
    <main>
      <div>Chat Page</div>
      <div>Chat ID: {chatId}</div>
    </main>
  )
};

export default Chat;
